import React, { useState } from 'react';

const Home = () => {
  const [teamA, setTeamA] = useState('');
  const [kitA, setKitA] = useState('');
  const [teamB, setTeamB] = useState('');
  const [kitB, setKitB] = useState('');
  const [referee1, setReferee1] = useState('');
  const [referee2, setReferee2] = useState('');
  const [youtube, setYoutube] = useState('');

  return (
    <div className="min-h-screen bg-gradient-to-br from-white via-blue-50 to-gray-100 flex flex-col items-center justify-center px-2 py-10">
      {/* Logo ve Site İsmi - Apple tarzı */}
      <div className="flex flex-col items-center mb-14 select-none">
        <img src="/logo192.png" alt="Logo" className="w-20 h-20 mb-4 drop-shadow-xl bg-white/60 rounded-full backdrop-blur-md" />
        <h1 className="text-5xl md:text-6xl font-extrabold text-gray-900 tracking-tight mb-2" style={{letterSpacing: '-0.03em'}}>Futbol Analiz</h1>
        <span className="text-lg md:text-xl text-gray-500 font-light">Modern Futbol Analiz Platformu</span>
      </div>

      {/* Glassmorphism Card */}
      <div className="w-full max-w-4xl bg-white/60 backdrop-blur-xl rounded-3xl shadow-2xl p-10 flex flex-col gap-10 border border-white/40">
        {/* Takımlar */}
        <div className="flex flex-col md:flex-row gap-8">
          {/* Takım A */}
          <div className="flex-1 bg-white/40 backdrop-blur-lg rounded-2xl p-8 shadow-md flex flex-col gap-4 border border-blue-100 transition-transform hover:scale-[1.02]">
            <h2 className="text-xl font-semibold text-blue-700 mb-2 text-center tracking-tight">Takım A</h2>
            <label className="block text-gray-700 font-medium">Takım İsmi</label>
            <input
              type="text"
              value={teamA}
              onChange={e => setTeamA(e.target.value)}
              className="w-full bg-white/70 border border-gray-200 rounded-xl px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-400 transition-all text-lg shadow-sm"
              placeholder="Takım A adı"
            />
            <label className="block text-gray-700 font-medium mt-2">Forma</label>
            <input
              type="text"
              value={kitA}
              onChange={e => setKitA(e.target.value)}
              className="w-full bg-white/70 border border-gray-200 rounded-xl px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-400 transition-all text-lg shadow-sm"
              placeholder="Forma rengi/numarası"
            />
          </div>
          {/* Takım B */}
          <div className="flex-1 bg-white/40 backdrop-blur-lg rounded-2xl p-8 shadow-md flex flex-col gap-4 border border-green-100 transition-transform hover:scale-[1.02]">
            <h2 className="text-xl font-semibold text-green-700 mb-2 text-center tracking-tight">Takım B</h2>
            <label className="block text-gray-700 font-medium">Takım İsmi</label>
            <input
              type="text"
              value={teamB}
              onChange={e => setTeamB(e.target.value)}
              className="w-full bg-white/70 border border-gray-200 rounded-xl px-4 py-2 focus:outline-none focus:ring-2 focus:ring-green-400 transition-all text-lg shadow-sm"
              placeholder="Takım B adı"
            />
            <label className="block text-gray-700 font-medium mt-2">Forma</label>
            <input
              type="text"
              value={kitB}
              onChange={e => setKitB(e.target.value)}
              className="w-full bg-white/70 border border-gray-200 rounded-xl px-4 py-2 focus:outline-none focus:ring-2 focus:ring-green-400 transition-all text-lg shadow-sm"
              placeholder="Forma rengi/numarası"
            />
          </div>
        </div>
        {/* Hakemler */}
        <div className="flex flex-col md:flex-row gap-8">
          <div className="flex-1">
            <label className="block text-gray-700 font-semibold mb-1">Hakem 1</label>
            <input
              type="text"
              value={referee1}
              onChange={e => setReferee1(e.target.value)}
              className="w-full bg-white/70 border border-gray-200 rounded-xl px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-300 transition-all text-lg shadow-sm"
              placeholder="Hakem 1 adı"
            />
          </div>
          <div className="flex-1">
            <label className="block text-gray-700 font-semibold mb-1">Hakem 2</label>
            <input
              type="text"
              value={referee2}
              onChange={e => setReferee2(e.target.value)}
              className="w-full bg-white/70 border border-gray-200 rounded-xl px-4 py-2 focus:outline-none focus:ring-2 focus:ring-green-300 transition-all text-lg shadow-sm"
              placeholder="Hakem 2 adı"
            />
          </div>
        </div>
        {/* YouTube Linki */}
        <div>
          <label className="block text-gray-700 font-semibold mb-1">YouTube Linki</label>
          <input
            type="text"
            value={youtube}
            onChange={e => setYoutube(e.target.value)}
            className="w-full bg-white/70 border border-gray-200 rounded-xl px-4 py-2 focus:outline-none focus:ring-2 focus:ring-red-400 transition-all text-lg shadow-sm"
            placeholder="YouTube video bağlantısı"
          />
        </div>
        {/* Özet Butonu */}
        <div className="flex justify-center mt-2">
          <button
            className="bg-gradient-to-r from-gray-900/90 to-blue-700/80 hover:from-gray-900 hover:to-blue-800 text-white font-bold py-3 px-16 rounded-full shadow-xl text-xl transition-all duration-200 transform hover:scale-105 focus:outline-none focus:ring-4 focus:ring-blue-200/60 backdrop-blur-lg bg-opacity-80"
            style={{backdropFilter: 'blur(8px)'}}
          >
            Özet
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
